Capt. Caleb Holt lives by the old firefighter's adage: Never leave your partner behind. Inside burning buildings, it's his 

natural instinct. In the cooling embers of his marriage, it's another story.

After seven years of marriage, Caleb and Catherine Holt have drifted so far apart that they are ready to move on without each 

other. Yet as they prepare to enter divorce proceedings, Caleb's dad asks his son to try an experiment: The Love Dare.

While hoping The Love Dare has nothing to do with his parents' newfound faith, Caleb commits to the challenge. But can he 

attempt to love his wife while avoiding God's love for him? Will he be able to demonstrate love over and over again to a 

person that's no longer receptive to his love? Or is this just another marriage destined to go up in smoke? 


